import React, { useState } from "react";

function PokemonCity() {
  const [city, setCity] = useState("");

  function updateCity(event) {
    setCity(event);
  }

  return (
    <form>
      <input
        type="text"
        placeholder="text"
        value={city}
        onChance={updateCity}
      />
      <p>Welcome to the city of {city}</p>
    </form>
  );
}

export default PokemonCity;
